import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [type, setSearchType] = useState('pin');
  const [query, setSearchQuery] = useState('');
  const [results, setResults] = useState([]);
  const [favorites, setFavorites] = useState([]);
  const baseUrl = 'http://localhost:4000/api';

  const handleSearch = async () => {
    try {
      const response = await axios.post(`${baseUrl}/search`, {
        type,
        query,
      });
      console.log(response.data[0])
      setResults(response.data);
    } catch (error) {
      console.error('Error fetching results:', error);
    }
  };

  const handleFavorite = async (result) => {
    try {
      const response = await axios.post(`${baseUrl}/result`);
      setFavorites((prev) => [...prev, response.data]);
      alert('Added to favorites!');
    } catch (error) {
      console.error('Error adding to favorites:', error);
    }
  };

  return (
    <div className="container mt-5">
      <h1>Pincode Search</h1>
      <div className="form-group">
        <div className="form-check form-check-inline">
          <input
            className="form-check-input"
            type="radio"
            name="searchType"
            id="pin"
            value="pin"
            checked={type === 'pin'}
            onChange={() => setSearchType('pin')}
          />
          <label className="form-check-label" htmlFor="pin">
            Search by PinCode
          </label>
        </div>
        <div className="form-check form-check-inline">
          <input
            className="form-check-input"
            type="radio"
            name="searchType"
            id="branch"
            value="branch"
            checked={type === 'branch'}
            onChange={() => setSearchType('branch')}
          />
          <label className="form-check-label" htmlFor="name">
            Search by BranchName
          </label>
        </div>
      </div>
      <div className="form-group mt-3">
        <input
          type="text"
          className="form-control"
          placeholder="Enter code or name"
          value={query}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
      </div>
      <button className="btn btn-primary mt-3" onClick={handleSearch}>
        Search
      </button>

      <table className="table table-bordered mt-4">
        <thead>
          <tr>
            <th>Name</th>
            <th>BranchType</th>
            <th>DeliveryStatus</th>
            <th>District</th>
            <th>Region</th>
            <th>State</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {results.map((result, index) => (
            <tr key={index}>
              <td>{result.name}</td>
              <td>{result.branchType}</td>
              <td>{result.deliveryStatus}</td>
              <td>{result.district}</td>
              <td>{result.region}</td>
              <td>{result.state}</td>
              <td>
                <button
                  className="btn btn-success"
                  onClick={() => handleFavorite(result)}
                >
                  Add to Favorites
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
